import React from 'react';
import Gallery from "./gallery";
import {cities} from "../app_data/cities_array";


class SearchPage extends React.Component{
    render() {
        console.log(this.props);
        return(
            <div className={"container-grid"} id={"fourth_row"}>
                <h1 className={"titel_of_boxs"}>My Apartments</h1>
                <Gallery apartments={this.props.apartments} cities={this.props.cities} loading={this.props.loading}/>
                {/*<h1 className={"titel_of_boxs"}>My Cities</h1>*/}
                {/*<Create_box items = {cities}/>*/}
            </div>
        )
    }
}

export default SearchPage;
